import React from "react";
import { Link } from "react-router-dom";
import "./navbar.css";
import { useState } from "react";

const Navbar = () => {
  const [openPopup, isOpen] = useState(false);
  return (
    <div>
      <nav className="header">
        <ul className="nav-left">
          <li>
            <Link to="/pages/home">
              <img src="/eventlylogo.svg" alt="evently logo" />
            </Link>
          </li>
          <li>
            <Link to="./pages/home">Evently</Link>
          </li>
        </ul>
        <ul className="nav-right">
          <li>
            <Link to="./pages/loginPage">Log In</Link>
          </li>
          <li>
            <Link onClick={() => isOpen(true)} to="./pages/signupPage">
              Sign Up
            </Link>
          </li>
          <li>
            <Link to="./pages/profile">
              <img src="/profilelogo.svg" alt="profile" />
            </Link>
          </li>
        </ul>
      </nav>
      <div>
        {/* <LogIn trigger={buttonPopup}></LogIn> */}
        {/* <SignUp trigger={openPopup}></SignUp> */}
      </div>
    </div>
  );
};
export default Navbar;
